note_models.css:
.card {
 font-family: arial;
 font-size: 20px;
 text-align: center;
 color: black;
background: var(--background-img) center 200px no-repeat;
}

.back {
 color: black;
 font-weight: bold;
}

.smallPrint {
 font-size: small;
}

.context {
	border-style: dotted;
	margin-top: 20px;
	font-size: medium;
}

:root {
	--background-img: null;
	--background-img-experimentation: url('data:image/png;charset=utf-8;base64,');
	--background-img-corona: url('data:image/jpeg;base64,')
}

tmpls.qfmt:
{{#Include Reverse}}<script language="javascript">
let tags = `{{Tags}}`.split(" ")
if(tags.indexOf("covid-19") != -1)
	document.body.style.setProperty("--background-img", "var(--background-img-corona)")
else if(tags.indexOf("experimentation-for-improvement") != -1)
	document.body.style.setProperty("--background-img", "var(--background-img-experimentation)")
</script>
{{Back}}
{{#Context}}<div class="context">Context: {{Context}}<br/></div>{{/Context}}
{{/Include Reverse}}

